'use strict';
class OpenPositionManagerOnChangedAction {
    listener;
    openPositionInfo;
    static create(openPositionInfo) {
        let result;
        result = new OpenPositionManagerOnChangedAction();
        result.openPositionInfo = openPositionInfo;
        return result;
    }
    setListener(listener) {
        this.listener = listener;
    }
    execute() {
        this.listener.onChange(this.openPositionInfo);
    }
}
module.exports = OpenPositionManagerOnChangedAction
